import React, { useEffect, useState } from "react";

const Courses = () => {
  const [courses, setCourses] = useState([]);
  const [name, setName] = useState("");
  const [description, setDescription] = useState("");

  // ‚úÖ Fetch Courses from Backend
  useEffect(() => {
    fetchCourses();
  }, []);

  const fetchCourses = () => {
    fetch("http://localhost:5000/courses")
      .then((response) => response.json())
      .then((data) => setCourses(data))
      .catch((error) => console.error("Error fetching courses:", error));
  };

  // ‚úÖ Add a New Course
  const addCourse = (e) => {
    e.preventDefault();
    fetch("http://localhost:5000/courses/add", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ name, description }),
    })
      .then((response) => response.json())
      .then((data) => {
        alert(data.message);
        setCourses([...courses, data.course]);
        setName("");
        setDescription("");
      })
      .catch((error) => console.error("Error adding course:", error));
  };

  // ‚úÖ Delete Course
  const deleteCourse = (id) => {
    if (window.confirm("Are you sure you want to delete this course?")) {
      fetch(`http://localhost:5000/courses/delete/${id}`, { method: "DELETE" })
        .then((response) => response.json())
        .then((data) => {
          alert(data.message);
          setCourses(courses.filter((c) => c._id !== id));
        })
        .catch((error) => console.error("Error deleting course:", error));
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>üìö Course Management</h2>

      {/* Add Course Form */}
      <form onSubmit={addCourse} style={styles.form}>
        <input
          type="text"
          placeholder="Course Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          style={styles.input}
        />
        <input
          type="text"
          placeholder="Course Description"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
          style={styles.input}
        />
        <button type="submit" style={styles.addButton}>
          ‚ûï Add Course
        </button>
      </form>

      {/* Course List */}
      {courses.length === 0 ? (
        <p style={styles.noCourses}>No courses found.</p>
      ) : (
        <div style={styles.cardGrid}>
          {courses.map((course) => (
            <div key={course._id} style={styles.card}>
              <h3 style={styles.courseName}>{course.name}</h3>
              <p style={styles.courseDescription}>{course.description}</p>
              <p style={styles.enrolled}>
                üéì Enrolled Students: {course.studentsEnrolled.length}
              </p>
              <button
                onClick={() => deleteCourse(course._id)}
                style={styles.deleteButton}
              >
                üóëÔ∏è Delete
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

// ‚úÖ Pro-Level Styling
const styles = {
  container: {
    maxWidth: "800px",
    margin: "auto",
    padding: "20px",
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
  },
  heading: {
    fontSize: "28px",
    fontWeight: "bold",
    marginBottom: "20px",
    color: "#333",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
    marginBottom: "20px",
    backgroundColor: "#f9f9f9",
    padding: "20px",
    borderRadius: "10px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
  },
  input: {
    padding: "12px",
    fontSize: "16px",
    borderRadius: "5px",
    border: "1px solid #ccc",
  },
  addButton: {
    backgroundColor: "#28a745",
    color: "white",
    padding: "12px",
    fontSize: "16px",
    borderRadius: "5px",
    border: "none",
    cursor: "pointer",
  },
  noCourses: {
    fontSize: "18px",
    fontWeight: "bold",
    color: "#666",
  },
  cardGrid: {
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(250px, 1fr))",
    gap: "15px",
  },
  card: {
    backgroundColor: "#fff",
    padding: "15px",
    borderRadius: "10px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    textAlign: "left",
  },
  courseName: {
    fontSize: "18px",
    fontWeight: "bold",
    color: "#333",
  },
  courseDescription: {
    fontSize: "14px",
    color: "#555",
  },
  enrolled: {
    fontSize: "14px",
    color: "#007bff",
  },
  deleteButton: {
    backgroundColor: "#dc3545",
    border: "none",
    padding: "8px 12px",
    borderRadius: "5px",
    cursor: "pointer",
    color: "white",
  },
};

export default Courses;
